local Manager = s_WordDictionaryDatabase; Manager.allwords["overload"]={"overload","[əʊvə'ləʊd]","[,ovɚ'lod]","v.超载",'v.超载,过载,超过负荷|||n.超载,负荷过多|||[计算机]过载','For analog inputs, any absolute voltage value above which the analog-to- digital converter cannot distinguish a change. The overload value can be different for plus and minus inputs.','就模拟输入而言，使模数转换器不能区别其变化的超范围的绝对电压值。超载值对于正输入和负输入可能不同。','The lights fused because the system was overloaded with electrical appliances.','电灯灭了, 因线路上用电器超负荷把保险丝烧断了.'}
